# Milestoneimport streamlit as stimport requestsimport pandas as pd# specific codes for API key = 'QC1O9GVDGRVR6UAU'ticker = 'IBM'size = 'full'url = 'https://www.alphavantage.co/query?function=TIME_SERIES_DAILY_ADJUSTED&symbol={}&outputsize={}&apikey={}'.format(ticker, size, key)response = requests.get(url)json_dict = response.json()metadata = json_dict['Meta Data']final_column_names = ['open', 'high', 'low', 'close', 'adjusted_close',        'volume', 'dividend_amount', 'split_coefficient']data = pd.DataFrame.from_dict(json_dict['Time Series (Daily)'], orient='index')data.rename(columns={col_original:col_new for col_original, col_new in zip(data.columns, final_column_names)}, inplace=True)st.title("Data Incubator - Milestone Project")st.write("Author: Catie Finkenbiner")option = st.selectbox(    'Which column would you like to plot?',     final_column_names)'You selected: ', option